import React from 'react'
import '../CSS/Work.css'

function WorkPage() {

    var myArray = ["one", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine", "Ten","Eleven"];

    return (
        <div className="work-page">
            
            {myArray.map((item) => <div style={{ backgroundColor: 'tomato', marginTop: '20px' }}>{item}</div>)}
        </div>
    )
}

export default WorkPage
